import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
`
const Left = styled.div`
  flex: 1;
`

const Center = styled.div`
  flex: 1;
`

const Right = styled.div`
  flex: 1;
`

const Footer = () => {
  return (
    <Container>
      <Left>
        <Logo>BOUTIQUE.</Logo>
        <Description>Customer-focused team players are becoming actionable capability experts. Our Corporate Enterprise solution offers low hanging fruit a suite of end-to-end offerings. We aim to proactively virtualise our cloud by globally incentivizing our world-class wholesale alignments. Going forward, our next-generation industry leader will deliver value to prince2 practitioners.</Description>
      </Left>
      <Center>Center</Center>
      <Right>Right</Right>
    </Container>
  )
}

export default Footer;
